    <script type="text/javascript">
        const buttonBack = document.querySelector('#button-back');
        const buttonNext = document.querySelector('#button-next');
        const listOfCardElements = document.querySelectorAll('.card');
        const cardElement = document.querySelector('.card');
        const cardContainer = document.querySelector('.card-container');
        let currentCard = 0;

        function setScrollTo() {
            const scrollLeft = currentCard * listOfCardElements[0].offsetWidth;
            cardContainer.scrollTo({
                left: scrollLeft
                , behavior: 'smooth'
            });
        }

        buttonBack.addEventListener('click', () => {
            if (currentCard > 0) {
                currentCard--;
            }
            setScrollTo();
        });

        buttonNext.addEventListener('click', () => {
            if (currentCard < listOfCardElements.length - 1) {
                currentCard++;
            }
            setScrollTo();
        });

        listOfCardElements.forEach((cardElement, index) => {
            cardElement.addEventListener('click', () => {
                currentCard = index;
                const scrollLeft = currentCard * listOfCardElements[0].offsetWidth;
                cardContainer.scrollTo({
                    left: scrollLeft
                    , behavior: 'smooth'
                });
            });
        });

    </script>

    <script>
        // Get the input element and table
        const input = document.getElementById('searchInput');
        const table = document.getElementById('myTable');
        const rows = table.getElementsByTagName('tr');

        // Add an event listener to the input element
        input.addEventListener('keyup', function () {
            const filter = input.value.toLowerCase();

            // Loop through all table rows and hide those that don't match the search query
            for (let i = 1; i < rows.length; i++) {
                const row = rows[i];
                const name = row.getElementsByTagName('td')[0];
                if (name) {
                    const text = name.textContent || name.innerText;
                    if (text.toLowerCase().indexOf(filter) > -1) {
                        row.style.display = '';
                    } else {
                        row.style.display = 'none';
                    }
                }
            }
        });
    </script>


